    };

    // main

    const target = obj ? obj : this;
    const isInstance = typeof target === 'object' ? true : false;

    return this.getAncestors(target, transformerFn(isInstance)).reduce((acc, item) => {
      Object.assign(acc, item);
      return acc;
    }, {} as any);
  }

